import {useSelector} from 'react-redux'

const Allusers = () => {

    const users = useSelector(state => state.systemUsers)

    return (
        <>
        {
            users && users.map(user => {
                return (
                    <div style={{border: '1px solid black', width: '75%', margin: '20px auto'}}>
                        <h1>{user.fullName}</h1>
                        <p>{user.userName}</p>
                    </div>
                )
            })
        }
        </>
    )
}

export default Allusers
